  const pages = ["Users"];
  const icon = "bi bi-house-up";

  return (
    <>
      <Header />
      <Sidebar />
      <PageTitle page="Users" pages={pages} icon={icon} />
      <main id="main" className="main">
        users
      </main>
    </>
  );
}

export default Users;
